    top: 55%;
    left: 50%;
    transform: translate(-50%, -50%);
}
.logo-image {
    background: var(--logo-image) top center/auto 50% no-repeat;
    width: 256px;
    height: 256px;
    animation: float-logo 3s ease-in-out infinite;
}

@keyframes float-logo {
    0%, 100% {
        transform: translateY(0);
    }
    50% {
        transform: translateY(-10px);
    }
}
.bottom-logo {
    position: absolute;
    background: var(--tripledot-image) no-repeat;
    width: 20vw;
    height: 20vw;
    max-width: 64px;
    max-height: 64px;
    background-size: contain;
    top: 87%;
    left: 49%;
    transform: translate(-50%, -50%);
}
.progress-container {
    width: 50%;
    height: 8px;
    background-color: #ccc;
    border-radius: 5px;
    overflow: hidden;
    margin: 20px auto;
    position: absolute;
    top: 70%;
    left: 50%;
    transform: translate(-50%, -50%);
    box-shadow: 0px 0px 5px 4px #87c892;
}

.progress-bar {
    width: 200%;
    height: 100%;
    background-image: repeating-linear-gradient(
        45deg,
        #4caf50,
        #4caf50 10px,
        #2a4e2c 10px,
        #2a4e2c 20px
    );
    animation: loading-stripes 10s linear infinite;
    position: absolute;
   
    left: -100%;
}

@keyframes loading-stripes {
    0% {
        left: -100%;
    }
    100% {
        left: 0%;
    }
}
</style></head>

    <div class="app-logo">
        <div class="logo-image"></div>
    </div>
    <div class="progress-container">
        <div class="progress-bar"></div>
    </div>
    <div class="bottom-logo"></div>
</div>
